 or older to drive.</li>\n<li>You must have a clean driving record with auto insurance.</li>\n<li>You consent to our driver screening and background check.</li>\n<li>You must own an iPhone or Android smartphone that can download and run the tyt Driver app.</li>\n</ul>', 'jVaKZ7cmFBp1uAuvjgn5sjxpeOEgSmMw8zduGTaf.jpg', '<h2>Vehicle Requirements</h2>\n\n<ul>\n<li>2008 or newer**</li>\n<li>4 doors</li>\n<li>5-8 seats, including the driver&rsquo;s</li>\n<li>North Carolina plates</li>\n<li><strong>**Car year may vary by region </strong></li>\n</ul>', '1RexFkyPOi1BErCFKU8uYwMm9mL5VzuysTWRaxaJ.jpg', '<h3>Document requirements</h3>\n\n<ul>\n<li>Driver profile photo</li>\n<li>Vehicle registration</li>\n<li>Personal vehicle insurance</li>\n<li>North Carolina vehicle inspection</li>\n</ul>', '9z3dVmaWgwUAtOQv4neyEfu5Oe58IZYfdfsCY5ZA.jpg', '<h1><strong>Download the Driver Blue app Today</strong></h1>', '<p><strong>Good things happen when people can move, whether across town or toward their dreams. Opportunities </strong></p>\n\n<p><strong>appear, open up, become reality.</strong></p>', '<h1><strong>Be your own boss</strong></h1>\n\n<h3>Hours are completely flexible. Drive mornings, evenings, weekdays, or weekends.</h3>', 'pOzcct0XNSuOSmSuWTDfP8ePmLMhZliODdQFwWTX.svg', '<h2><strong>Download</strong></h2>', '<p>Download the Blue Driver App from the Google Play or App Store on your smartphone.</p>', '5rNx2yDAFIbo90GugqyGWQ7UdpU9s0HPIDpZVmH2.svg', '<h2><strong>Upload</strong></h2>', '<p>Upload your driver required documents in the app. Get Approved</p>', 'OPx6uFwmzO5u99oNFgB9zXPRMkskpD491gmqPTAQ.svg', '<h2><strong>Drive!</strong></h2>', '<p>Drive and earn as much as you want. Get paid weekly for the time and distance of a trip plus tips.</p>', '<h2><strong>Why Drive with Blue</strong></h2>', '<p><strong>About us</strong></p>', 'CkXGI95QRqqefSia0gxn3CVeHxiALzoZgWFbaOJO.png', '<p>Blue is a rideshare platform facilitating peer to peer ridesharing by means of connecting passengers who are in need of rides from drivers with available cars to get from point A to point B with the press of a button. tyt is a clever 4 letter word that sounds like &quot;easy&quot; a fantastic connotation of effortless ease and accessibility to get you to your destination. tyt welcomes applicants year-round - summer, winter, fall, spring, and holiday work seekers.</p>', '<p>Our Mission</p>', 'wxZlB9jU3D51XbnxyhbeQMFXqNLgyHMUKIJ2WXx4.png', '<p>It&rsquo;s our goal to create a flexible working environment that is inclusive and reflects the diversity of the cities we serve&mdash;where everyone can be their authentic self, and where that authenticity is celebrated as a strength. By creating an environment where people from every background can thrive, we&rsquo;ll make tyt a better company&mdash;for our drivers and our customers.</p>', '<p>Driver Commitment</p>', 'laHGbcRZ8YbrFYXQcWq1HebYW4HhdnuvTOtD3CKH.png', '<p>We promise to provide the technology and the support needed to empower you to be your own boss, deciding on when and how often you drive. Let us take you places. Through our software, we take the guesswork and hassle out of securing your fare. We will always seek to apply technological advancements to the current process in order that the driver is fully equipped to operate in the given climate.</p>', 'J47s4D1AxvdoB7YWbARxCpEexbT1puAR8NVHRUgr.jpg', 'JIaEaUVL7Q5BpRHwxL3KbclM44BcYmsyIXvDdL7i.png', '<p><strong>Download the Driver App</strong></p>', '<p><strong>Real-Time ETA Prediction</strong></p>', '<p><strong>Customer Referral</strong></p>', '<p><strong>In-App Chat</strong></p>', '<p><strong>Emergency SOS Button</strong></p>', 'PNAhDhAI8UxQ21JUDxkm0ZAoRwjSMStz8Amg41aU.jpg', '<h3>Get the app</h3>', 'yJp1Givor2pcQZjmKHpwVObJPlN8gGFonIyM3bOy.png', '<p>Get the app on Apple App Store or Google Play</p>', '<p>You can complete the application in the tyt Driver App</p>', '8EmDtFUTSOfgNddshqJksMDaKdjhdljkQtocoUXJ.png', '<h3>Apply to drive</h3>', '<h3>Get Approved</h3>', '1v9jBpYjpsBxP0krKKN4eo16nGqotzQbCOViIEWV.png', '<p>After uploading your required documents and passing the background checks, you&rsquo;re ready to hit the road and start earning.</p>', '<p>Open the app and turn on driver mode</p>', 'LJPfXEJzwSDoebFVLyG3ye02Eu1EmUNdM2LzmdSA.png', '<p>Open the app</p>', '<h3>Accept a passenger</h3>', '4xTQJVd9MJSQiQgsPrkxmWco5lfnKgPMTa0oS9Iu.png', '<p>Accept a passenger ride request</p>', '<p>Pick up your passenger at their location</p>', 'vzgfJTndfgLAHJZToPd2LgJ8NSshNW5jR3yasY52.png', '<h3>Pick up</h3>', '<h3>Drop off</h3>', 'SH4JqHAeVXj9Mkz78giGIjxGqyob02kpjMk1fhFq.png', '<p>Drop off your passenger at their destination</p>', '2024-01-01', '2024-05-09', 'INAO5d4sUN0rFwuobaHoRVwiof9c5So89YaxnaND.jpg', '<p>Get In Touch With Us</p>\n\n<p>Have a question, inquiry or comment? Feel free to contact us. Simply fill in the contact form or just select your preferred channel and send us a message. We&rsquo;ll do everything we can to respond quickly.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>Address: </strong><br />\n60A/6A, Vilangurichi Road,Ramakrishnapuram, Saravanampatti,Coimbatore-641006.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>Email: </strong><br />\nMedia Inquiries: <a href=\"mailto:media@tyt.us\">media@tyt.us</a><br />\nPartnership Inquiries: <a href=\"mailto:partner@tyt.us\"> partner@tyt.us</a><br />\nFile a complaint: <a href=\"mailto:compliance@tyt.us\"> compliance@tyt.us</a><br />\nGeneral Inquiries: <a href=\"mailto:info@tyt.us\"> info@tyt.us</a></p>', 'https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3915.8124423896343!2d76.99306681417376!3d11.052684457057428!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3ba85c1faf9dbe73%3A0x68dc9947d4882eff!2sTaxi%20Dispatch%20Software%2FSystem%20%7C%20White%20Label%20Taxi%20App%20-%20TagYourTaxi!5e0!3m2!1sen!2sin!4v1616142939290!5m2!1sen!2sin', 'https://apps.apple.com/in/app/tagxi-driver/id1608868990', 'https://play.google.com/store/apps/details?id=com.tagxi.operator\"', 'https://apps.apple.com/in/app/tagxi/id1608868419', 'https://play.google.com/store/apps/details?id=com.tagxi.user', '#ffffff', '#01f0ff', '#01f0ff', '#01f0ff', '#01f0ff', '#31c1df', '#31c1df', 'YU6rXTgLNYCFDbP1McFDktqvMYZrcZGHHn272oBT.png', NULL, NULL, NULL, NULL, NULL, 'tdudabWbRLGJ2sThDlemCiCwJjF9GiB48ItBy00X.png', 'https://tagxi-landing.ondemandappz.com/', 'https://tagxi-landing.ondemandappz.com/', 'tagxi_landing@gmail.com');
